import React from 'react';

const MyProfile = ({posts, token, setPosts}) => {
    console.log('posts', posts)
    return <>
        <h1>My Profile</h1>
        {
            token && posts.isAuthor ? posts.map(post => <div>MyPosts: {post}</div>) : 'No Posts'
        }
    </>
}

export default MyProfile;
